import{_ as e,o,c as a,O as s}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 3.2-5102 Commissioner to have access to factories, warehouses, and other places; examination of samples.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5102.md","filePath":"vacode/3.2-5102.md"}'),t={name:"vacode/3.2-5102.md"},r=s('<h1 id="§-3-2-5102-commissioner-to-have-access-to-factories-warehouses-and-other-places-examination-of-samples" tabindex="-1">§ 3.2-5102 Commissioner to have access to factories, warehouses, and other places; examination of samples. <a class="header-anchor" href="#§-3-2-5102-commissioner-to-have-access-to-factories-warehouses-and-other-places-examination-of-samples" aria-label="Permalink to &quot;§ 3.2-5102 Commissioner to have access to factories, warehouses, and other places; examination of samples.&quot;">​</a></h1><p>The Commissioner shall have free access at all reasonable hours to any factory, warehouse, or establishment in which foods are manufactured, processed, packed, or held for introduction into commerce, or to enter any vehicle being used to transport or hold such foods in commerce, or any store, restaurant, or other place in which food is being offered for sale for the purpose of:</p><ol><li><p>Inspecting such factory, warehouse, establishment, or vehicle to determine if any of the provisions of this chapter are being violated; and</p></li><li><p>Securing samples or specimens of any food after paying or offering to pay for such sample. It shall be the duty of the Commissioner to make or cause to be made examinations of samples secured under the provisions of this section to determine whether or not any provision of this chapter is being violated.</p></li></ol><p>This section shall not apply to nonprofit organizations holding one-day food sales.</p><p>Code 1950, § 3-319; 1966, c. 702, § 3.1-399; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0420" target="_blank" rel="noreferrer">420</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',5),i=[r];function n(c,h,l,p,f,m){return o(),a("div",null,i)}const _=e(t,[["render",n]]);export{u as __pageData,_ as default};
